import Container from "../components/Container/Container";

export default function Design() {
  return (
    <Container>
      <div className="page">
        <h1>Design</h1>
        <h2>Design</h2>
        <h3>Design</h3>
        <p>Design</p>
        <style jsx>
          {`
            .page {
              margin: 0 2.5rem;
            }

            h1,
            h2,
            h3 {
              font-family: "Raleway";
            }

            p {
              font-family: "Raleway";
            }

            *:nth-child(1) {
              background-color: black;
              color: white;
              padding: 0.25rem;
            }

            @media only screen and (max-width: 1024px) {
              *:nth-child(1) {
                margin: 1.5rem 0;
              }
            }
          `}
        </style>
      </div>
    </Container>
  );
}
